import React from 'react';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import {ScreenNames} from '../../constants/strings';
import OnBoardingScreen from '../../screens/auth/onBoardingScreen';
import GetStartedScreenOne from '../../screens/auth/signUpScreen';
import GetStartedScreenTwo from '../../screens/auth/phoneInputScreen';
import GetStartedScreenThree from '../../screens/auth/otpScreen';
import OTPScreen from '../../screens/auth/otpScreen';

const AuthStack = createNativeStackNavigator();

const navigationOptions = () => ({
  headerShown: false,
  animationEnabled: true,
  animationTypeForReplace: 'push',
  animation: 'slide_from_right',
});

const Auth = () => {
  return (
    <AuthStack.Navigator initialRouteName={ScreenNames.BoardingScreen}>
      <AuthStack.Screen
        name={ScreenNames.BoardingScreen}
        component={OnBoardingScreen}
        options={navigationOptions}
      />
      <AuthStack.Screen
        name={ScreenNames.StartScreenOne}
        component={GetStartedScreenOne}
        options={navigationOptions}
      />
      <AuthStack.Screen
        name={ScreenNames.StartScreenTwo}
        component={GetStartedScreenTwo}
        options={navigationOptions}
      />
      <AuthStack.Screen
        name={ScreenNames.StartScreenThree}
        component={OTPScreen}
        options={navigationOptions}
      />
    </AuthStack.Navigator>
  );
};

export default Auth;
